const HomePage = ({Image_One, Image_Two, Image_Three, name, title}) =>(
        <div>
            <img src={Image_One}  alt = {Image_One}/>
            <img src={Image_Two}  alt = {ImageTwo}/>
            <img src={Image_Three}  alt = {ImageThree}/>
            <h4> {name}</h4>
            <p>{title}</p>
        </div>
    );

export default HomePage;
